import React from 'react';
import HeaderSection from '../Header.js/header';
import TileCard from '../TileCard/TileCard';
import './Catalog.css'
import Footer from '../footer/footer'

const Catalog = () => {
    const tiles = [
        { 
            id: 1, 
            title: '2023 Tesla Model S', 
            description: 'Experience the ultimate in electric performance with the Tesla Model S. Featuring cutting-edge technology, unmatched range, and sleek design.', 
            image: 'tesla-model-s.png' 
        },
        { 
            id: 2, 
            title: '2024 BMW X5', 
            description: 'The BMW X5 combines luxury, power, and versatility. Perfect for family adventures or city driving, with advanced features and a spacious interior.', 
            image: 'bmw-x5.png' 
        },
        { 
            id: 3, 
            title: '2023 Audi Q8', 
            description: 'The Audi Q8 offers a dynamic driving experience with a bold, sporty design and a refined, high-tech interior. Ideal for those who crave both style and substance.', 
            image: 'audi-q8.png' 
        },
    ];

    return (
        <div style={{ padding: '20px', maxWidth: '1000px', margin: '0 auto' }}>
            <HeaderSection />
            <div style={{ display: 'flex', justifyContent: 'space-around', marginTop: '20px' }}>
                {tiles.map(tile => (
                    <TileCard key={tile.id} title={tile.title} description={tile.description} image={tile.image} />
                ))}
            </div>
            <button className="view-more-button">View more</button>
        </div>
    );
};

export default Catalog;
